import React from 'react';
import { AppBar, Toolbar, Typography, Box, Stack } from '@mui/material';
import BatteryFullIcon from '@mui/icons-material/BatteryFull';
import GpsFixedIcon from '@mui/icons-material/GpsFixed';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import SignalCellularAltIcon from '@mui/icons-material/SignalCellularAlt';

const TopBar = () => {
  return (
    <AppBar
      position="static"
      elevation={10}
      style={{
        background: 'rgba(15, 23, 42, 0.8)',
        backdropFilter: 'blur(10px)',
        borderBottom: '1px solid rgba(255,255,255,0.1)',
      }}
    >
      <Toolbar sx={{ display: 'flex', justifyContent: 'space-between' }}>
        <Typography variant="h6" sx={{ fontWeight: 700 }}>
            ðŸ¤– Drone Dashboard
            </Typography>


        <Stack direction="row" spacing={3} alignItems="center">
          <Box display="flex" alignItems="center" gap={1}>
            <BatteryFullIcon color="primary" />
            <Typography>87%</Typography>
          </Box>
          <Box display="flex" alignItems="center" gap={1}>
            <GpsFixedIcon color="secondary" />
            <Typography>Locked</Typography>
          </Box>
          <Box display="flex" alignItems="center" gap={1}>
            <SignalCellularAltIcon sx={{ color: '#00ff88' }} />
            <Typography>Excellent</Typography>
          </Box>
          <Box display="flex" alignItems="center" gap={1}>
            <AccessTimeIcon />
            <Typography>14:22:31</Typography>
          </Box>
        </Stack>
      </Toolbar>
    </AppBar>
  );
};

export default TopBar;
